local distancescale = 10
local showingimaps = false

Citizen.CreateThread(function()
    while true do
        Citizen.Wait(0)
        if toggleimaps then
            for k,v in pairs(all_imaps_list) do -- this is a horrible way to do it. If you have a more effecient way please PR
                local isValid, position, heading = Citizen.InvokeNative(0x9C77964B0E07B633, v.dec_hash, Citizen.PointerValueVector(), Citizen.PointerValueFloat(), Citizen.ResultAsInteger(), Citizen.ReturnResultAnyway())
                local location = GetEntityCoords(PlayerPedId())
                local distance = #(position- location)

                if distance < distancescale then
                    --print(v.dec_hash) -- Some people might find this useful for copying from their CFX log (AppData\Local\FiveM\FiveM.app\logs)
                    DrawLine(v,location,distance,v.dec_hash.." , "..GetHashKey(tostring(v.dec_hash)))
                    --SetEntityCoords(PlayerPedId(), vector3(v.x,v.z,v.z)) -- you can teleport to each one if thats your cup of tea
                    showingimaps = true
                end
            end
            toggleimaps = false
        end
    end
end)

RegisterCommand('loadimap',function(source, args) -- load the requested Imap (Needs to be a hash)
    local isValid, position, heading = Citizen.InvokeNative(0x9C77964B0E07B633, tonumber(args[1]), Citizen.PointerValueVector(), Citizen.PointerValueFloat(), Citizen.ResultAsInteger(), Citizen.ReturnResultAnyway())
    if isValid then
        RequestImap(tonumber(args[1]))
    end
end)

RegisterCommand('removeimap',function(source, args) -- remove the requested Imap (Needs to be a hash)
    local isValid, position, heading = Citizen.InvokeNative(0x9C77964B0E07B633, tonumber(args[1]), Citizen.PointerValueVector(), Citizen.PointerValueFloat(), Citizen.ResultAsInteger(), Citizen.ReturnResultAnyway())
    if isValid then
        RemoveImap(tonumber(args[1]))
    end
end)

RegisterCommand('viewimaps',function(source, args)
    if args[1] ~= nil then
        distancescale = tonumber(args[1])
        toggleimaps = true

    end
end)
RegisterCommand('stopviewimaps',function(source, args)
    showingimaps = false
end)


function DrawLine(v,location,distance,name) -- Many thanks to mooshe for the inspiration for this
    Citizen.CreateThread(function()
        local position = vector3(v.x,v.y,v.z)
        while true and showingimaps do
            Citizen.InvokeNative(`DRAW_LINE` & 0xFFFFFFFF ,position.x,position.y,position.z,position.x,position.y,500.0,255, 0, 30,255)
            if #(position-GetEntityCoords(PlayerPedId())) < 5 then
                TxtAtWorldCoord(position.x,position.y,position.z,tostring(name),0.2,1)
            end
            Wait(0)
        end
    end)
end



function TxtAtWorldCoord(x, y, z, txt, size, font, alpha) --Cant remember where i got these two from. If someone knows please give me a pm on discord!
    alpha = alpha or 255
    local s, sx, sy = GetScreenCoordFromWorldCoord(x, y ,z)
    if (sx > 0 and sx < 1) or (sy > 0 and sy < 1) then

        local s, sx, sy = GetHudScreenPositionFromWorldPosition(x, y, z)
        DrawTxt(txt, sx, sy, size, true, 255, 255, 255, alpha, true, font) -- Font 2 has some symbol conversions ex. @ becomes the rockstar logo
    end
end

function DrawTxt(str, x, y, size, enableShadow, r, g, b, a, centre, font)
    local str = CreateVarString(10, "LITERAL_STRING", str)
    SetTextScale(1, size)
    SetTextColor(math.floor(r), math.floor(g), math.floor(b), math.floor(a))
    SetTextCentre(centre)
    if enableShadow then SetTextDropshadow(1, 0, 0, 0, 255) end
    SetTextFontForCurrentCommand(font)
    DisplayText(str, x, y)
end
